$\textbf{Tempat Kenangan Lama Juan}$

Juan mengatur perangko dalam koleksinya berdasarkan negara dan dekade saat perangko tersebut diterbitkan. Harga yang dia bayar di toko perangko adalah: Brasil dan Prancis, $6$ sen masing-masing, Peru $4$ sen masing-masing, dan Spanyol $5$ sen masing-masing. (Brasil dan Peru adalah negara di Amerika Selatan dan Prancis serta Spanyol berada di Eropa.) [asy]
/* AMC8 2002 #8, 9, 10 Problem */
size(3inch, 1.5inch);
for ( int y = 0; y <= 5; ++y )
{

draw((0,y)--(18,y));
}
draw((0,0)--(0,5));
draw((6,0)--(6,5));
draw((9,0)--(9,5));
draw((12,0)--(12,5));
draw((15,0)--(15,5));
draw((18,0)--(18,5));

label(scale(0.8)*"50s", (7.5,4.5));
label(scale(0.8)*"4", (7.5,3.5));
label(scale(0.8)*"8", (7.5,2.5));
label(scale(0.8)*"6", (7.5,1.5));
label(scale(0.8)*"3", (7.5,0.5));

label(scale(0.8)*"60s", (10.5,4.5));
label(scale(0.8)*"7", (10.5,3.5));
label(scale(0.8)*"4", (10.5,2.5));
label(scale(0.8)*"4", (10.5,1.5));
label(scale(0.8)*"9", (10.5,0.5));

label(scale(0.8)*"70s", (13.5,4.5));
label(scale(0.8)*"12", (13.5,3.5));
label(scale(0.8)*"12", (13.5,2.5));
label(scale(0.8)*"6", (13.5,1.5));
label(scale(0.8)*"13", (13.5,0.5));

label(scale(0.8)*"80s", (16.5,4.5));
label(scale(0.8)*"8", (16.5,3.5));
label(scale(0.8)*"15", (16.5,2.5));
label(scale(0.8)*"10", (16.5,1.5));
label(scale(0.8)*"9", (16.5,0.5));

label(scale(0.8)*"Negara", (3,4.5));
label(scale(0.8)*"Brasil", (3,3.5));
label(scale(0.8)*"Prancis", (3,2.5));
label(scale(0.8)*"Peru", (3,1.5));
label(scale(0.8)*"Spanyol", (3,0.5));

label(scale(0.9)*"Koleksi Perangko Juan", (9,0), S);
label(scale(0.9)*"Jumlah Perangko per Dekade", (9,5), N);
[/asy] Berapakah harga rata-rata, dalam sen, dari perangko $70\text{'s}$ miliknya? Bulatkan jawaban Anda ke seperseratus sen terdekat.

