original_question:
Segitiga $ABC$ adalah segitiga sama kaki, dengan $AB=AC$ dan tinggi $AM=11.$ Misalkan ada titik $D$ pada $\overline{AM}$ dengan $AD=10$ dan $\angle BDC=3\angle BAC.$ Temukan keliling segitiga $ABC.$

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

